export class GameModel
{
    name: string;
    genre: string;
    price: number;
    releaseDate: date;

    constructor(name: any,genre: any,price: any,releaseDate: any){
      this.name = name;
      this.genre = genre;
      this.price = price;
      this.releaseDate = releaseDate;
    }

    toJSON(){
      return{
        name: this.name,
        genre: this.genre,
        price: this.price,
        releaseDate: this.releaseDate,
      }
    }
}
